INSERT INTO `khoroji_eghdam` VALUES (1,110101,3141,'*گزارش برگزاری جلسه توجیهی  برای دانشجویان تحصیلات تکمیلی  واطلاع رسانی در زمینه  سیاست های تشویقی دانشگاه برای پایان نامه های کاربردی شامل (زمان برگزاری،اعضای هیأت رئیسه جلسه،تعدادشرکت کنندگان به تفکیک رشته و مقطع،تعیین درصدحضوردانشجویان باتوجه به تعدادورودی های جدید، رئوس موضوعات طرح شده درجلسه',NULL),(2,NULL,3141,'تکمیل اطلاعات صفحه دانش آموختگان در وب سایت دانشکده به تفکیک گروه های آموزشی شامل (رشته و مقطع، وضعیت ادامه تحصیل،وضعیت اشتغال، افتخارات و موفقیت های دانش آموختگان ، اخبار مربوط به برگزاری نشست های مدیران دانشکده  با دانش آموختگان، لیست همکاری های مشترک  دانشکده با دانش آموختگان و....)',NULL),(3,NULL,3141,'صورتجلسه شعبه در زمینه راهکارهای کاهش رتبه های ورودی\nپیشنهادات شعبه در زمینه افزایش تعداد دانشجویان و مکاتبات انجام شده در این زمینه',NULL),(4,NULL,3101,'گزارش  تفاهم نامه های منعقد شده با مراکز پژوهشی  وگزارش مربوط به نشست های مشترک با سایر مراکز پژوهشی',NULL),(5,NULL,2114,'لیست کارگاه های برگزار شده در زمینه مهارت افزایی و کارآفرینی شامل اطلاعات (عناوین کارگاه،تعداد شرکت کنندگان به تفکیک اساتید ،دانشجویان و کارکنان)،حضور یا عدم حضور کارافرینان موفق در کارگاه،نتایج نظرسنجی از کارگاه\nمکاتبات یا صورت جلسات در زمینه شناسایی دانشجویان مستعد کارافرینی  ونتایج حاصله ',NULL),(6,NULL,3101,'-',NULL),(7,NULL,3141,'گزارش اقدامات انجام شده در زمینه اعمال مدیریت سبز در ازمایشگاه،کتابخانه و سایت شعبه\nگزارش میزان پیشرفت پروژه ازمایشگاه زبان شناسی',NULL),(8,NULL,2115,'لیست آزمایشگاه های تجهیز شده دانشکده ها  شامل اطلاعات (نام آزمایشگاه، نیازهای تجهیزاتی، محل تامین منابع مالی، موارد انجام شده)\nگزارش فعالیت های انجام شده پیرامون اجرای سیاست های مدیریت سبز',NULL),(9,NULL,2116,'گزارش اقدامات انجام شده در زمینه استقرار نرم افزار جامع کتابخانه ونتایج حاصله\nگزارش فعالیت های انجام شده و یا در حال انجام پروژه ی تجمیع کتابخانه های دانشگاه\nگزارش فعالیت های انجام شده پیرامون اجرای سیاست های مدیریت سبز ',NULL),(10,NULL,2112,'صورتجلسات/گزارش اقدامات تشویقی و انگیزشی اعضای هیات علمی در زمینه پژوهش‌های بین‌المللی\nلیست فعالی