INSERT INTO `review` VALUES (1,'22',NULL,'<p>\r\n\tبا سلام و احترام</p>\r\n<p>\r\n\tبنظر می رسد که در این شاخص اینجانب به دلیل اینکه عضو کمیته عملیاتی کردن برنامه راهبردی می باشم و مرتبا گزارشات سه ماهه خود را براساس شاخص های مورد نظر ارائه می نمایم و همچنین بعنوان کارشناس IT دانشکده با برآورد نیازها و ارائه گزارشات به معاونت محترم پژوهشی و اجرایی دانشکده و درخواست بودجه و تهیه کلیه تجهیزات دانشکده و همچنین با توجه به اینکه کارشناس ترفیع و ارتقا اعضای هیات علمی دانشکده می باشم ، با تهیه گزارشات جهت تبدیل وضعیت اساتید و... دارای شرایط جهت&nbsp; کسب امتیاز کامل این شاخص باشم .</p>\r\n<p>\r\n\tبعنوان مثال یکی از گزارشاتی که اینجانب هرساله ارائه&nbsp; می نمایم . گزارش عملکرد دانشکده به شکل فایل پاورپوینت و ارائه آن در جشن آخر ساله دانشکده می باشد .که به پیوست ارسال می گردد.</p>\r\n<p>\r\n\tدر فرم خودارزیابی قبلی ، گزارشات دیگر ارسال گردیده بود .</p>\r\n',0,'2017-05-21 08:26:23','eydane96.pptx','شیوا','دلاوری',30510003,'6/24','6/4'),(3,'20',NULL,'<p>\r\n\tدر شاخص مذکور مستند پیشنهاد ثبت شده در سامانه نظام پیشنهادها بوده است که ارسال گردیده است.</p>\r\n',0,'2017-05-21 08:53:03','khalaghiat.docx','افسانه','دورودیان',11000002,'6/71','7/24'),(4,'14',NULL,'<p>\r\n\tدر شاخص مذکور مستندات مربوط به کارگزوهی و تیمی پیوست شده است.</p>\r\n',0,'2017-05-21 08:54:34','karegoroohi.rar','افسانه','دورودیان',11000002,'7/9','8/52'),(5,'14',NULL,'<p>\r\n\tبا سلام و احترام&nbsp;</p>\r\n<p>\r\n\tنظر به اینکه عملکرد اینجانب بنا به تایید مدیریت امورحقوقی و مستندات پیوست در کارگروهی کامل بوده و همکاران من در این واحد نیز با همین مستندات نمره کامل را دریافت داشته اند .خواهشمند است مجدداً بررسی نمایید.</p>\r\n',0,'2017-05-21 09:02:16','1495341136._scan0267.jpg','آزیتا','مطیعیان',15000003,'7.9','8.52'),(6,'14',NULL,'<p>\r\n\tمستندات به شرح ذیل تکمیل می گردد.لطفا مجددا بررسی گردد.</p>\r\n',0,'2017-05-21 09:04:36','karegoroohi zohre ghasemi.rar','زهره','قاسمی پور',11000005,'7.9','8.52'),(7,'15',NULL,'<p>\r\n\tدوره های آموزشی از طرف مدیریت برنامه و بودجه تعیین می گردد و در آنها شرکت نموده ام. گواهی دوره ها به شرح پیوست جهت بررسی ارسال می گردد.</p>\r\n',0,'2017-05-21 09:06:33','1495341393._govahi.pdf','زهره','قاسمی پور',11000005,'6.1','6.52'),(8,'22',NULL,'<p>\r\n\tبا سلام و احترام</p>\r\n<p>\r\n\tنظر به اینکه گزارش های این واحد محرمانه بوده و ارائه مستندات امکانپذیر نمی باشد لکن نحوه و اصول گزارش نویسی در آن رعایت شده است و بعضا گزارش به مقامات بالاتر ارسال گردیده و مورد استناد واقع شده است لذا خواهشمند است نسبت به تخصیص امتیاز این شاخص تجدید نظر نمایید.</p>\r\n',0,'2017-05-21 09:08:13','azita motiiyan96.2.30.docx','آزیتا','مطیعیان',15000003,'4.53','6.4'),(9,'20',NULL,'<p>\r\n\tبا سلام و احترام</p>\r\n<p>\r\n\tدر اعتراض به امتیاز شاخص کار گروهی (14) حضور فعال در همکاری های های گروهی بدون در نظر گرفتن محدودیت زمانی و مکانی با توجه به اسناد ارائه شده در نظر گرفته نشده است. پیوست فیزیکی دارد.</p>\r\n<p>\r\n\tدر اعتراض به شاخص دوره های آموزشی ( 15) هم در دوره های آموزشی مربوط به کتابداری و بانکهای اطلاعاتی و هم در دوره های آموزشی مرتبط با آموزش و مدیریت آموزشی شر کت نموده ام . مدارک به پیوست می باشد.</p>\r\n<p>\r\n\tدر اعتراض به شاخص خلاقیت و نوآوری(&nbsp;20 ) موارد ارائه پیشنهادات جهت بهبود شرایط و محیط کاری&nbsp; برای تسهیل در امور محوله به پیوست ضمیمه می باشد .</p>\r\n<p>\r\n\tدر اعتراض به شاخص گزارش دهی (22)&nbsp; و (24) و(25) گزارش عملکرد به پیوست می باشد. قابل ذکر است یکی از واحدهای گذرانده شده در دانشگاه برای این جانب گزارش نویسی می باشد و در ضمن اینجانب علاوه بر تسلط به نرم افزار کتابخانه سیمرغ و پارس آذرخش) به نرم افزار گلستان نیز مسلط میباشم (به دلیل نیاز شغلی به آشنایی با این دو نرم افزار) و دوره های&nbsp; ICDL را نیز گذرانده ام و در آموزش این مهارت به همکاران نیز دریغ نمی ورزم مدارک به پیوست ضمیمه می باشد و ضمنا مدارک آموزشی در پرونده کارگزینی&nbsp;بایگانی می باشد</p>\r\n<p>\r\n\tقبلا از حسن نظر گرانقدران کمال تشکر رادارد.&nbsp;</p>\r\n<p>\r\n\tبا سپاس</p>\r\n<p>\r\n\tلوئی</p>\r\n',0,'2017-05-21 09:11:53','1495341714._1488089817._khalaghiat1.zip','لیلا','لوئی',31010003,'برای شاخص 14 7/7و برای شاخص 20 امتیاز5/49 برای شاخص 22 5/12',' برای شاخص 14امتیاز 8/52 و برای شاخص 20 7/24برای شاخص 22 6/4'),(10,'2',NULL,'<p>\r\n\tبا سلام و احترام&nbsp;</p>\r\n<p>\r\n\tبا توجه &nbsp;به اطلاعات مندرج در سیستم گردش کار، اینجانب در طی یک سال گذشته هیچ تاخیر و تعجیل غیر قانونی و غیبتی نداشته ام. جهت استحضار فایل گردش کار تمام یک سال گذشته به پیوست ارسال می گردد. &nbsp;با تشکر از حسن توجه شما</p>\r\n',0,'2017-05-21 10:20:41','1495345841._Hozor 94-11 -96-02-Samadian.pdf','مریم ','صمدیان',23000008,'6.312','6.84'),(13,'2',NULL,'<p>\r\n\tشایان ذکر است که بنده حق استفاده از ساعات شیردهی داشته</p>\r\n',0,'2017-05-21 10:30:45','1495346445._Binder2.pdf','فرانک','نیسی',23000009,'5.124','6.50'),(14,'5',NULL,'<p>\r\n\tبا سلام و احترام&nbsp;</p>\r\n<p>\r\n\tامتیاز مکتسبه در این بخش مورد اعتراض است و دلیل و سند قانونی برای کسر این امتیاز باید از طرف ارزیابی کننده ارائه گردد نه ازطرف ارزیابی شونده . لطفا دلایل و مدارک قانونی دال بر عدم رعایت شاخص فوق را در صورت تایید نمره داده شده به بنده ارسال فرمایید تا بنده نیز در جریان عدم رعایت مورد فوق به صورت قانونی قرار بگیرم. با تشکر از حسن همکاری شما</p>\r\n',0,'2017-05-21 10:35:39','1495346739._TaghdirName  Samadian-95.jpg','مریم','صمدیان',23000008,'3.312','3.84'),(15,'22',NULL,'<p>\r\n\tبا سلام واحترام. نظر به تهیه اکثر گزارشات ارسالی دانشکده توسط اینجانب به صورت پیشنویس برای مقام مافوق و ارسال آنها به سایر واحدهای دانشگاه، به عنوان نمونه دو مورد از گزارشات اینجانب پیوست می شود. خواهشمند است نسبت به کسب حداکثر امتیاز این شاخص مساعدت&nbsp;گردد. با احترام، ریحانه ماله میر&nbsp;</p>\r\n',0,'2017-05-21 10:35:47','reihane malemir.gozareshdehi.rar','ریحانه','ماله میر',30510006,'5.78','6.4'),(18,'13',NULL,'<p dir=\"RTL\">\r\n\tبا سلام و احترام<br />\r\n\tامتياز مكتسبه در شاخص شماره 13 &nbsp;مورد اعتراض اينجانب است و دليل و سند قانوني براي كسر اين امتياز بايد از طرف ارزيابي كننده ارائه گردد نه ازطرف ارزيابي شونده.</p>\r\n<p dir=\"RTL\">\r\n\tلطفا دلايل و مدارك قانوني دال بر عدم رعايت شاخص فوق را در صورت تاييد نمره داده شده به بنده ارسال فرماييد تا من نيز در جريان عدم رعايت مورد فوق به صورت قانوني قرار بگيرم. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; با تشكر از حسن همكاري شما.</p>\r\n',0,'2017-05-21 10:51:21','1495347681._TaghdirName  Samadian-95.jpg','مریم','صمدیان',23000008,'2.484','2.88'),(20,'14',NULL,'<p>\r\n\tبنده در هر برنامه ایی که از سوی واحد برگزار می گردد مشارکت داشته و همکاری تنگاتنگ انجام داده ام ، که یک مورد آن حکم داشته و موارد دیگر حکمی دریافت ننموده ام نه تنها من هیچ یک</p>\r\n',0,'2017-05-21 11:08:03','1495348683._slygudljvnbjrvrc.pdf','فرانک','نیسی',23000009,'7.27','8.52'),(23,'10',NULL,'<p>\r\n\tبا سلام و احترام</p>\r\n<p>\r\n\tچنانچه نیرویی بدون وجودامکانات مناسب ( فضایی - مکانی - تجهیزاتی ) باتمام توان اقدام به رفع مشکل گروه خود نموده است نیروی بی انگیزه تلقی نمی شود . خواهشمند است میزان علاقه فرد به&nbsp;حرفه اش را از کسانی که در تعامل مستقیم با نیرو ( مدیر گروه .&nbsp; اعضای هیات علمی )&nbsp;&nbsp;را بوده اند پی گیری فرمایید. با استناد به نامه ریاست محترم دانشکده ایا قدر دانی از زحمات کارمند بی انگیزه جایز بوده ا ست ؟</p>\r\n',0,'2017-05-21 01:22:26','ghadrdani.tooba zarichi.pdf','طوبی','زریجی',30891003,'2/784','3/84'),(24,'14',NULL,'<p>\r\n\tبا سلام و احترام .</p>\r\n<p>\r\n\tاینجانب طوبی زریجی&nbsp; مسئول دفتر گروه شیمی</p>\r\n<p>\r\n\tبنا بر ضرورت و درخواست ریاست محترم دانشکده&nbsp; در کلیه زمانهای ثبت نام&nbsp; دانشجویان&nbsp; در دانشکده&nbsp; چند روز متوالی&nbsp; به همراهی با &nbsp;کارمندان آ موزش دانشکده در&nbsp;این کار گروهی ( ثبت نام&nbsp;) شرکت داشته ام &nbsp;.</p>\r\n',0,'2017-05-21 01:56:02','kare groohi.tooba zarichi.jpg','طوبی','زریجی',30891003,'7/8','8/52'),(26,'1',NULL,'<p>\r\n\tبا سلام و ا حترام</p>\r\n<p>\r\n\tاینجانب طوبی زریجی&nbsp; مسئول دفتر گروه شیمی</p>\r\n<p>\r\n\tدر کلیه کارهای گروهی دانشکده ( ثبت نام ها --- مراقبتهای امتحانی ----&nbsp; رای گیری از دانشجویان در خصوص انتخاب نماینده جهت معرفی به ریاست دانشگاه -همکاری با دفتر دانشکده در زمان غیبت مسئول دفتر دانشکده در جهت اداره دفتر دانشکده و همکاری و همیاری بادانشکده و در تعامل با مسائل دانشکده بوده ام</p>\r\n',0,'2017-05-21 02:18:20','list moraghebin.doc','طوبی','زریجی',30891003,'3/36','3/52'),(27,'22',NULL,'<p>\r\n\tباید مستندات ارائه دهند که بنده این شاخص را ندارم<br type=\"_moz\" />\r\n\t&nbsp;</p>\r\n',0,'2017-05-21 02:51:04','1495362064._1487676347._gozaresh.rar','فرانک','نیسی',23000009,'4.74','6.4'),(28,'20',NULL,'<p>\r\n\tبا توجه به اینکه همیشه در محیط کار به دنبال ایجاد نوآوری و استفاده بهتر از امکانات بوده ام &nbsp;به نظر می رسد با مقایسه با دیگر همکاران واحد های مختلف و سقف امتیاز در نظر گرفته شده، به تشخیص خود استحقاق حداکثر نمره را در این زمینه دارم .لازم به ذکر است در سال گذشته فقط چند پیشنهاد در سطح دانشگاه مورد موافقت قرار گرفته است، که یکی از این پیشنهادها از طرف اینجانب ارسال شده است و مستحق تشویق مالی نیز قرار گرفته است.</p>\r\n',0,'2017-05-21 03:00:44','1495362644._inovation.rar','شبنم','عباسی',18100005,'5.312','7/24'),(29,'20',NULL,'<p>\r\n\tبا توجه به ارائه پیشنهادات</p>\r\n',0,'2017-05-22 07:48:39','1495423119._Innovation.pdf','رکسانا','رضایی',18100004,'5.62','7.24'),(31,'25',NULL,'<p>\r\n\t<br type=\"_moz\" />\r\n\t&nbsp;مدارک</p>\r\n<p>\r\n\t&nbsp; WOR -&nbsp; WINDOWS نظر به اینکه در نقاط ضعف ایشان از نظر ریاست محترم دانشکده این موارد قید شده است . مدارک به خدمت ارسال میگردد.</p>\r\n',0,'2017-05-22 09:54:37','1495430677._WINDON.jpg','طوبی','زریجی',30891003,' 552 /  2','3/52'),(32,'20',NULL,'<p>\r\n\tبا سلام و احترام</p>\r\n<p style=\"text-align: justify;\">\r\n\tطی صحبت تلفنی با سرکار خانم خطیبی متوجه شدم مستندات این بخش را کامل وارد نکرده و باید از پیشنهادات جدول ب در این فرم عکس یا خود مستند را ارسال می کردم که به پیوست این فایل را جهت استحضار ارسال می دارم، همچنین<strong> تهیه و تنظیم فرم کار دانشجویی</strong>&nbsp; از مواردی است که سال گذشته انجام داده و از قلم افتاده بود که در جدول اضافه و مستند مربوطه ضمیمه گردید.</p>\r\n<p style=\"text-align: justify;\">\r\n\tبا تشکر</p>\r\n',0,'2017-05-22 10:06:45','1495431405._mostanadat.rar','خدیجه','چناری',30620001,'5.342','7'),(33,'20',NULL,'<p>\r\n\tسرپرست محترم مرکز ارزیابی و پایش عملکرد</p>\r\n<p>\r\n\tبا سلام و احترام</p>\r\n<p>\r\n\tضمن تشکر از زحمات سرکارعالی و همکارانتان، باتوجه به مستندات تکمیلی &nbsp;اینجانب در خواست تجدید نطر در ارزیابی خود را دارم.پ</p>\r\n<p>\r\n\tبا تشکر</p>\r\n<p>\r\n\tعینی</p>\r\n',0,'2017-05-22 10:57:55','1495434475._noavari.rar','خدیجه ','عینی',11000004,'5/24','7/24'),(34,'14',NULL,'<p>\r\n\tبا توجه به نوع مسئولیت بنده هماهنگی با 14 کارشناس و سه نیروی خدماتی تمامی امور هماهنگی و پی گیری می بایست از سوی دفتر انجام پذیرد.</p>\r\n',0,'2017-05-22 11:10:26','1495435226._1487752008._grohi (1).rar','طاهره','حسین زاده',23000004,'7.27','8.52'),(35,'14',NULL,'<p>\r\n\tبا سلام و احترام</p>\r\n<p>\r\n\tبه نظر می رسد هماهنگی با واحدهای دیگر برای برگزاری 9 کارگاه آموزشی در طول یک سال&nbsp; از رزرو سالن تا هماهنگی های&nbsp;لازم برای دعوت از سخنران،اطلاع رسانی از طریق سامانه های فرهنگی ، حراست، نقلیه، پذیرایی و...&nbsp; نشانگر کار گروهی موفق و دریافت امتیاز کامل باشد .&nbsp;</p>\r\n',0,'2017-05-22 12:12:12','1495438932._A (1).docx','آسیه ','سفیری',24200010,'8/036','8/52'),(36,'15',NULL,'<p>\r\n\tکلیه اقدامات انجام شده برای برگزاری دوره های آموزشی در اداره بهداشت و سلامت با همکاری اینجانب و دکتر سلامی صورت می پذیرد .</p>\r\n',0,'2017-05-22 12:15:50','1495439150._A (1).docx','آسیه ','سفیری',24200010,'6/34','6/52'),(37,'12',NULL,'<p>\r\n\tآموزش به دیگران در قالب برگزاری کارگاه ها ، سخنرانی ها، قرار دادن مطالب علمی و مناسب با مناسبت هابی بهداشتی در سایت اداره بهداشت&nbsp;و سلامت معاونت دانشجویی و در کانال دانشجویان الزهرا صورت می پذیرد .</p>\r\n',0,'2017-05-22 12:27:59','1495439879._A (1).docx','آسیه ','سفیری',24200010,'2/484','2/88'),(38,'22',NULL,'<p>\r\n\tاینجانب با توجه به احساس مسئولیتی که برای حفظ بیت المال&nbsp;در خود احساس می کنم ، تلاش می&zwnj;کنم که گزارش دهی به صورت کامل باشد که نمونه آن به پیوست حضورتان ارسال می&zwnj;گردد .</p>\r\n<p>\r\n\tشایان ذکر است که برای مورد 4( وجدان کاری و حسن خلق&nbsp;) و مورد&nbsp;5 ( تکریم ارباب رجوع ) نمی توان مستنداتی ارائه کرد ولی می توان با تحقیق از کارکنان حوزه کاری هر فرد مثلاً برای اینجانب کارکنان آشپزخانه و بوفه به این مهم دست یافت .</p>\r\n<p>\r\n\tدر پایان موفقیت شما عزیزان را از درگاه خداوند متعال خواهانم.</p>\r\n',0,'2017-05-22 12:46:36','1495440996._D.pdf','آسیه ','سفیری',24200010,'6','6/4'),(39,'1',NULL,'<p>\r\n\tبا توجه به اینکه هرساله اینجانب تمدید قرارداد می گردم پس حتما مورد تایید گزینش بوده ، همچنین بنده از خانواده شهدا، جانباز و رزمنده بوده خانم دکتر خادمی باید مستنداتی دال بر عدم این شاخص ارائه دهند . بنده تاییدیه گزینش مرکز را دارا بوده، فرزند رزمنده، خواهر جانباز و همسر خواهر اینجانب اولین شهید شاخص دولت شناخته شده اند . در ضمن خواستارم که نوشته &quot; توجه بیشتر به ارزشهای اسلامی و انقلابی &quot; از راهکارهای پیشنهادی بهبود عملکرد ارزیابی شونده پاک گردد.</p>\r\n',0,'2017-05-22 12:50:10','1495441210._Scan30006.JPG','فرانک','نیسی',23000009,'2.784','3.84'),(40,'2',NULL,'<p>\r\n\tخواهشمند است با توجه به تاخیر و تعجیل های بنده با توجه به گردش کار تجدید نظر شود.</p>\r\n<p>\r\n\tاینجانب در بسیاری از روزها بعد ساعت اداری وحتی 5 شنب و جمعه ها جهت انجام کار اداری در اداره حضور داشتم.</p>\r\n',0,'2017-05-22 12:52:33','1495441353._absent.docx','نسرین ','رمضانی',24200001,'5.312','6.84'),(41,'1',NULL,'<p>\r\n\tبا توجه به تمدید قرارداد هر ساله اینجانب با دانشگاه در نتیجه بنده این شاخص را دارا بوده ، خانم دکتر خادمی باید مستنداتی دال بر عدم این شاخص در بنده ارائه دهند . همچنین بنده خواستاد حذف شدن جمله : &quot;توجه به ارزشهای اسلامی &quot; از بند راهکارهای پیشنهادی هستم.</p>\r\n',0,'2017-05-22 01:01:49','1495441909._Scan1.JPG','زهرا','رامتین',23000005,'2.784','3.84'),(42,'4',NULL,'<p>\r\n\tبا توجه به این که در این واحد مسئولیت های مختلف برعهده بنده می باشد&nbsp;که اصلی ترین آن ها&nbsp;برگزاری دورهای&nbsp;آموزش می باشد و با توجه به این که در این بخش به عنوان برترین دانشگاه در سال 94 انتخاب شدیم و به عنوان مسئول کمیته آموزش دانشگاه های منطقه 1 انتخاب شدیم و در سال 95 دو برابر سال 94 دوره و سمینار آموزشی در دانشگاه الزهرا س برگزار کردیم که بیانگر وجدان کاری اینجانب می باشد و از جهت خودکنترلی باوجه به این خانم دکتر لیموچی به دلیل مشغله زیاد ادامه ی تحصیل و واحدهای دانشکده کمتر در اداره حضور دارند به نظر می رسد که اگر وجدان کاری و خودکنترلی&nbsp; کارشناس نباشد موفقیت میسر نمی شود.</p>\r\n0',0,'2017-05-22 01:12:59','1495442579._amoozesh.docx','نسرین ','رمضانی',24200001,'3.84','3.312'),(43,'22',NULL,'<p>\r\n\tبا سلام و احترام</p>\r\n<p style=\"text-align: justify;\">\r\n\tدرخصوص فرم شماره ب در این شاخص باید به استحضار برسانم نوع کار من که کارشناس سایت می باشم بیشتر جنبه ی عملی داشته ن مثلا در طراحی و بازسازی سالن سایت پیشنهادات سازنده و بهبود دهنده وضعیت موجود ارائه دادم که کاملا اجرایی و مورد موافقت مسئول واقع شد و تمام چیدمان و طراحی سایت جدید باعث راحتی مراجعه کنندگان گردید و من مستندی نسبت به عملکرد خود ضمیمه نکردم و بنا به نوع کارم مستندات مکتوب موجود ندارم مگر عکس سایت بعد از تعمیرات که اکنون پیوست می کنم.</p>\r\n<p style=\"text-align: justify;\">\r\n\tضمنا به استحضار می رسانم بازه ارزشیابی کارکنان در زمانی صورت گرفت که اینجانب در مرخصی زایمان بودم و نتوانستم گواهی از رئیس دانشکده تهیه کنم.</p>\r\n<p style=\"text-align: justify;\">\r\n\tخواهش می کنم بررسی و تجدید نظر نمایید.</p>\r\n<p style=\"text-align: justify;\">\r\n\tتشکر</p>\r\n',0,'2017-05-22 01:29:40','1495443580._DSC_0707.JPG','بهنوش','ریاحی',30600002,'3.024','7'),(44,'6',NULL,'<p>\r\n\tبا توجه به مسئولیت های مختلف بنده اعم از 1- برگزاری دوره ها و سمینارهای ورزشی که پروسه بسیار سختی دارد و باید به موقع انجام پذیرد که فرآیند هر یک از دورها به شرح زیر می باشد : - اخذ مجوز از معاونت و فدراسیون های مربوطه، اطلاع رسانی به دانشجویان، پاسخگویی به ارباب رجوع، ثبت نام، هماهنگی با مدرس، تهیه مکان، مجوز ورود و خروج، درخواست هزینه، تسویه حساب های مالی ، تهیه گزارش و ارائه گواهی به شرکت کنندگان. در برخی موارد این دوره ها به صورت هفتگی انجام می شود و جدای از این مسئولیت،درج اخبار در سایت،گزارش ماهیانه،فعالیت های انجمن ورزشی دانشجویی، کار دانشجویی،کلیه فعالیت های ورزش کارکنان، مسابقات منطقه کارکنان، میزبانی مسابقات کارکنان، مشاوره علمی مرکز مشاوره دانشجویی، مشاوره ورزشی کارکنان، تغذیه و رژیم غذایی اعضای تیم های ورزشی و ... دیگر فعالیت هایی هست که بنده انجام می دهم که با توکل به خدا و یاری خدا هیچ گونه خللی در انجام مسئولیت های واگذار شده نبود و همه ارباب رجوع ها رضایت کامل وجود داشته که ناشی از احساس مسئولیت بنده حقیر می باشد. بنابراین اینجانب توقعنمره کامل را در این بخش داشتم.ممنون از مساعدت شما</p>\r\n',0,'2017-05-22 01:33:54','1495443834._mas.docx','نسرین','رمضانی',24200001,'3.84','3.12'),(45,'20',NULL,'<p>\r\n\tاحتراماً به استحضار می رساند یکی از اقداماتی که در چند سال اخیر در دانشگاه و خوابگاهها&nbsp;صورت می پذیرد بازیافت کاغذ می باشد که قبلاً در دانشگاه انجام نمی شد ولی با پیگیری های اینجانب از سال 93 تاکنون ادامه دارد.امید است با انجام این کار،&nbsp; بتوانیم گامی در جهت حفظ محیط زیست مان برداریم.</p>\r\n',0,'2017-05-22 01:37:08','1495444029._A (2).docx','آسیه','سفیری',24200010,'5/784','7/24'),(47,'22',NULL,'<p>\r\n\tبا سلام و احترام در این مورد توانایی نگارش گزارشات بارها بنده در پایان هر سال گزارش کامل - جامع و مطمءن در مورد وظایف محوله ( ترفیع- ارتقاء و بقیه کارها با مستندات داده شده است و بطور قطع و یقیقن نمی توانم این را بپذیرم.</p>\r\n',0,'2017-05-22 01:54:27','1495445067._22222.pdf','زهرا','نظری',31000007,'4.31','6.4'),(48,'14',NULL,'<p>\r\n\tکار گروهی بنده بدون شک بر همه&nbsp; آشکار است و از انجا که بنده با توجه به اینکه در روابط عمومی دانشکده هستم و ذر تمام مراسمات عزا- شادی و.... تمام مسئولیت های اجرایی را انجام داده ام و همچنین در کارهای آموزشی به همراه کارمندان آموزش مراقبت های امتحانی بودم . و در کارهای صندوق قرض الحسنه دانشکده هنر مسئولیت دارم</p>\r\n',0,'2017-05-22 02:00:00','zahra nazari.jpg','زهرا ','نظری',31000007,'5.59','7.56'),(49,'10',NULL,'<p>\r\n\tبا توجه به این بنده در بسیاری از روزها که نیاز بوده بعد از ساعت اداری حضور داشتم که در گردش کار قابل رویت هست و حتی3 ماه اول سال تحصیلی علی رغم این که درمرکز مشاوره حضور فعال داشتم و هیچ گونه اضافه کاری تا الان دریافت نکردم .همینطور 3 ماه اول سال ساعات ناهار را برای کارکنان تست مشاوره را انجام داده ام. روزهای 5 شنبه و جمعه برای برگزاری دوره ها در دانشگاه حضور داشتم و با توجه به این که ماندن در بعد از ساعت کاری در صورتی که کار ضروری نباشد ودریافت حق الزحمه از نظر شرعی مشکل داردلذا اینجانب در روزهایی که نیاز کاری بوده حتما حضور داشتم و بنابراین انتظار اخذ نمره کامل را از مسئولین مافوق در این قسمت داشتم. بنده حتی بعد از ساعات اداری پاسخگویدانشجویان از طریق تلگرام و مبایل هستم که مستنداتآن موجود می باشدو خواهشمند است مطابق گردش کار اینجانب تجدید نظر شود.</p>\r\n',0,'2017-05-22 02:07:24','1495445844._day.docx','نسرین','رمضانی',24200001,'2.76','3.2'),(50,'21',NULL,'<p align=\"center\" dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tباسمه تعالی</p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\t<strong>سرکار خانم دکتر مداحی</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\t<strong>مدیر محترم مرکز پایش و ارزیابی عملکرد</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tبا سلام &nbsp;و احترام</p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tنظر به اعلام نتایج ارزیابی عملکرد کارکنان در سال 1395، در خصوص موارد مطرح شده در ارزیابی اینجانب، نکات ذیل ارائه می&shy;گردد:</p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tدر خصوص بند 21 و موارد ذکر شده در نقاط ضعف و راهکارهای پیشنهادی بهبود عملکرد ارزیابی شونده مربوط به این بند، شامل عدم مدیر زمان و فشردگی کارها در مرحله آخر، ضعف در برنامه&shy;ریزی به موقع امور، مدیریت بهینه زمان و برنامه ریزی سالیانه و تمرکز بر فعالیت های حوزه کاری و پرهیز از کارهای متفرقه:</p>\r\n<p dir=\"RTL\">\r\n\tاینجانب به طور همزمان بخش مراسم مسابقات و فعالیت&shy;های قرآنی دانشگاه را عهده&shy;دار هستم. که بخشی از فعالیت&shy;های صورت گرفته در نیم سال اول تحصیلی 95 -96 (از شهریور تا دی ماه ) به پیوست ارائه می&shy;گردد. در سه ماه دی بهمن و اسفند ماه 1395، برپایی مرحله دانشگاهی مسابقات قرآن کریم بخش شفاهی و هماهنگی برپایی بخش کتبی این مسابقات به همراه برنامه&shy;های مناسبتی دهه فجر و مسابقاتی که در این خصوص برگزار گردید، همچنین مسئول و دستیار مسئول سه اردوی دانشجویی مشهد مقدس معاونت فرهنگی، همکاری در شانزدهمین جشنواره پایان نامه&shy;های قرآنی دانشجویان، همکاری در برپایی جشنواره لباس مشاغل اداری بانوان و برپایی مسابقه کتابخوانی شهدا، تنها بخشی از کارهای اینجانب در سال 1395 بوده است. که به نظر می رسد این چند مسیولیتی و همکاری با کارکنان دیگر معاونت فرهنگی و اجتماعی به جای اینکه نقطه مثبت عملکرد اینجانب در نظر گرفته شده جز نقاط منفی ذکر شده است. در مورد مدیریت زمان و برنامه ریزی سالیانه، نامه اداری شماره 616/6/95د با موضوع ارائه برنامه&shy; سالانه فرهنگی سال 1395 توسط اینجانب تنظیم و به خانم دکتر خادمی ارسال گردیده و به نظر می&shy;رسد این مورد نیز باید جزو نقاط قوت اینجانب محسوب می&shy;شده نه نقاط ضعف. در خصوص عبارت ذکر شده در فرم ارزیابی (تمرکز بر فعالیت&shy;های حوزه کاری و پرهیز از کارهای متفرقه) باید اعلام کنم اینجانب و بسیاری از همکاران دیگر معاونت فرهنگی به طور فعال در اکثریت برنامه&shy;های این واحد که در حوزه کاری ما تعریف نشده همکاری می&shy;کنیم و به این قضیه، هم به دید کار گروهی و هم به دید کمک به همکار نگاه می&shy;کنیم.&nbsp; کار متفرقه دیگری که اینجانب انجام داده&shy;ام همکاری در برپایی امتحانات پایان ترم گروه معارف دانشگاه بوده که در این خصوص نیز خانم دکتر خادمی موافقت خود را با این همکاری اعلام نمودند که نامه اداری آن موجود می&shy;باشد. در خصوص سرپرستی و دستار سرپرستی اردوی مشهد با توجه به اینکه هیچ یک از کارکنان معاونت فرهنگی شرایط انجام این کار را نداشتند، بنده تنها به دلیل اینکه اردوی مشهد مقدس بود، با وجود اینکه صاحب فرزند دو ساله&shy;ای هستم، مسئولیت سنگین برپایی اردوی مشهد را با افتخار عهده دار شدم. و در دو اردوی بعد نیز به عنوان دستیار سرپرست شرکت کردم و در &shy;تمام موارد مذکور نیز معاونت محترم فرهنگی کاملاً در جریان این همکاری بوده&shy;اند و تقسیم وظایف و تصویب این نحوه مشارکت در جلسات داخلی معاونت فرهنگی با حضور ایشان انجام شده است. شایان ذکر است مشغله کاری اینجانب در حدی است که بسیاری از روزها زمان صرف ناهار را صرف انجام مسئولیتهای شغلی می&shy;نمایم و کلیه همکاران معاونت می&shy;توانند این مورد را تأیید نمایند. با شرح ذکر شده و با توجه به اینکه وجود عبارت پرهیز از کارهای متفرقه در فرم ارزیابی اینجانب بدون شرح کامل موارد فوق، ممکن است منجر به برداشت دیگری گردد، خواهشمند است این نامه به همراه فرم فوق ثبت شود و همچنین در صورت امکان از سرکارعالی خواهشمند است از خانم دکتر خادمی در خصوص شرح کامل منظور ایشان از به کار بردن عبارت کارهای متفرقه و ارائه مستندات آن &nbsp;که در فرم ارزیابی اینجانب ذکر نمودند، استعلام به عمل آید.</p>\r\n',0,'2017-05-22 02:10:50','1495446050._21.rar','زهرا ','صدری',23000010,'1.392','1.92'),(51,'20',NULL,'<p>\r\n\tاز آنجا که بنده در جهت بهبود شرایط پیشرفت دانشکده و کارهای محوطه با نظر مستقیم ریاست محترم دانشکده پیشنهادات سازنده ای در خصوص راه اندازی کلاسهای آموزشی برای فرزندان کارکنان و همچنین بالا بردن سطح مالی در صندوق قرض الحسنه دانشکده هنر داشتم لذا در این زمینه می توانم حق خوبی داشته باشم برای کسب امتیاز لازم. با تشکر</p>\r\n',0,'2017-05-22 02:12:23','yalda.zahra nazari.pdf','زهرا','نظری',31000007,'4.33','7.24'),(53,'22',NULL,'<p>\r\n\tبا سلام و احترام</p>\r\n<p>\r\n\tدر خصوص گزارش دهی از آن جا که کلیه گزارش های آماری این مدیریت بر عهده اینجانب می باشد در خواست تجدید نظر دارم. لازم به ذکر است دو عکس از سامانه هایی که ارائه گزارش به آن ها صورت می گیرد نیز بار گذاری می گردد.</p>\r\n',0,'2017-05-22 02:25:48','1495446948._amoozeshali.jpg','ناتالی','گدایلو',11000006,'4.53','6.4'),(54,'22',NULL,'<p>\r\n\tمستند 2</p>\r\n',0,'2017-05-22 02:29:50','1495447190._pajuhesh.jpg','ناتالی','گدایلو',11000006,'4.53','6.4'),(55,'14',NULL,'<p>\r\n\tباتوجه حجم بالای کاروقت ارسال مدارک نبود لظفا بازبینی نمایید</p>\r\n',0,'2017-05-22 02:31:37','1495447298._Downloader.docx','منصور','بصیر',25300002,'5.536','8'),(56,'15',NULL,'<p>\r\n\tباتوجه به حجم بالای کاروقت ارسال مدارک نداشتم لطفا بررسی نمایید</p>\r\n',0,'2017-05-22 02:42:21','1495447941._attachments-aposwdhb.zip','منصور','بصیر',25300002,'4.042','6.3'),(57,'20',NULL,'<p>\r\n\tباتوجه به ارسال مدارک &nbsp;لطفا بازبینی گردد</p>\r\n',0,'2017-05-22 02:58:43','mansoor basir sodoor check.docx','منصور','بصیر',25300002,'7.24','6.75'),(58,'10',NULL,'<p>\r\n\tبسمه تعالی</p>\r\n<p>\r\n\t&nbsp;سلام . خسته نباشید.</p>\r\n<p>\r\n\tدر خصوص میزان تمایل وعلاقه به انجام وظیفه شغلی ، ریاست محترم دانشکده مکررا اعلام داشته اند که اینجانب نسبت به وظیفه ام بی علاقه می باشم و البته من نمیدانم ایشان از کجا به چنین نتیجه گیری رسیده اند . در حالیکه اینجانب با تمام کمبودها&nbsp;&nbsp;( فضایی . مکانی . امکانات و تجهیزاتمورد نیاز یک کارمند ) همیشه &nbsp;سعی در رفع مشکلات &nbsp;و حل نمودن&nbsp; مسائل &nbsp;نموده ام. جدا از انکه در تمامی موارد که دانشکده نیاز به همکاری داشته است&nbsp; صادقانه وصمیمانه انجام وظیفه نموده ام . و در تشویق ارسالی ایشان نیز&nbsp; مورد ملاحظه میگردد. و بسیار جای تعجب است که ا یشان از زحمات &nbsp;و همکاری یک نیروی بی انگیزه قدر دانی می نمایند ؟</p>\r\n',0,'2017-05-22 02:58:54','ghadr dani.pdf','طوبی','زریچی',30891003,'2/784',' /784 3'),(59,'20',NULL,'<p>\r\n\tبا سلام و احترام</p>\r\n<p>\r\n\tباستحضار می رساند اینجانب از ابتدای شهریور تا اوایل آبان به دلیل شرایط بد بارداری مرخصی استعلاجی داشتم و بعد از آن هم مرخصی زایمان و این باعث شد که نتوانم مستندات را به طور کامل وارد و تهیه نمایم لطفا با توجه به مستندات پیوست درخواست تجدید نظر دارم.</p>\r\n<p>\r\n\tبا تشکر</p>\r\n',0,'2017-05-22 03:05:09','behnoosh riahi.pdf','بهنوش','ریاحی',30600002,'7.626','8.52'),(60,'22',NULL,'<p>\r\n\tباتوجه به مدارک لطفابازبینی شود</p>\r\n',0,'2017-05-22 03:05:20','1495449320._attachments-ngnylbxi.zip','منصور','بصیر',25300002,'6.4','6'),(64,'3',NULL,'<p align=\"center\" dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tباسمه تعالی</p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\t<strong>سرکار خانم دکتر مداحی</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\t<strong>مدیر محترم مرکز پایش و ارزیابی عملکرد</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tبا سلام &nbsp;و احترام</p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tنظر به اعلام نتایج ارزیابی عملکرد کارکنان در سال 1395، در خصوص موارد مطرح شده در ارزیابی اینجانب، نکات ذیل ارائه می&shy;گردد:</p>\r\n<p dir=\"RTL\">\r\n\tدر خصوص بند 3 حسن خلق( مدارا و حسن معاشرت با مدیران و همکاران) شایان ذکر است، این مورد با رفتار اینجانب در محیط کار با همکاران مطابقت ندارد. سعی بنده در طول خدمتم در خوابگاه و معاونت فرهنگی و اجتماعی همواره بر این بوده که با احترام کامل با همکاران و مراجعینم برخورد کنم. اعلام نظر همکاران فرهنگی که به پیوست ارائه می&shy;گردد مؤید این نکته است . در کنار اینکه خود خانم دکتر خادمی در مورد بند 5 تکریم ارباب رجوع ( ادب، خوشرویی، خویشتنداری، سعه صدر و تواضع در برخورد با مراجعین) نمره کامل برای بنده لحاظ نموده&shy;اند نیز این مطلب را تأیید می&shy;نماید. این در حالی است که در خصوص بند 11 تعاملات ( برقراری ارتباط میان فردی مناسب با همکاران و مدیران و ایجاد تفاهم و تعامل مناسب) که با بند 3 و 5 ارتباط تنگاتنگی دارد شاهد اعلام نظر دیگری از خانم دکتر خادمی هستم. در حالی که هر سه بند ذکر شده گویای شخصیت اجتماعی افراد است و در صورت نقص در هر کدام باید در موارد دیگر هم نقصان مشاهده گردد. با توجه به این مطالب از سرکارعالی استدعا دارم در خصوص استعلام از خانم دکتر خادمی در مورد ذکر نمونه&shy;های عدم مدارا و حسن معاشرت و همچنین عدم تعامل مناسب در محیط کار در بنده دستور لازم را مبذول فرمایید.</p>\r\n',0,'2017-05-22 03:42:56','1495451576._hosnekholgh.pdf','زهرا','صدری',23000010,'3.312','3.84'),(65,'11',NULL,'<p align=\"center\" dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tباسمه تعالی</p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\t<strong>سرکار خانم دکتر مداحی</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\t<strong>مدیر محترم مرکز پایش و ارزیابی عملکرد</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tبا سلام &nbsp;و احترام</p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tنظر به اعلام نتایج ارزیابی عملکرد کارکنان در سال 1395، در خصوص موارد مطرح شده در ارزیابی اینجانب، نکات ذیل ارائه می&shy;گردد:</p>\r\n<p dir=\"RTL\">\r\n\tدر خصوص بند 11 تعاملات ( برقراری ارتباط میان فردی مناسب با همکاران و مدیران و ایجاد تفاهم و تعامل مناسب) شایان ذکر است، این مورد با رفتار اینجانب در محیط کار با همکاران مطابقت ندارد. سعی بنده در طول خدمتم در خوابگاه و معاونت فرهنگی و اجتماعی همواره بر این بوده که با احترام کامل با همکاران و مراجعینم برخورد کنم. اعلام نظر همکاران فرهنگی که به پیوست ارائه می&shy;گردد مؤید این نکته است . در کنار اینکه خود خانم دکتر خادمی در مورد بند 5 تکریم ارباب رجوع ( ادب، خوشرویی، خویشتنداری، سعه صدر و تواضع در برخورد با مراجعین) نمره کامل برای بنده لحاظ نموده&shy;اند نیز این مطلب را تأیید می&shy;نماید. این در حالی است که در خصوص بند 3 که با بند 11و 5 ارتباط تنگاتنگی دارد شاهد اعلام نظر دیگری از خانم دکتر خادمی هستم. در حالی که هر سه بند ذکر شده گویای شخصیت اجتماعی افراد است و در صورت نقص در هر کدام باید در موارد دیگر هم نقصان مشاهده گردد. با توجه به این مطالب از سرکارعالی استدعا دارم در خصوص استعلام از خانم دکتر خادمی در مورد ذکر نمونه&shy;های عدم مدارا و حسن معاشرت و همچنین عدم تعامل مناسب در محیط کار در بنده دستور لازم را مبذول فرمایید.</p>\r\n',0,'2017-05-22 03:46:11','1495451771._hosnekholgh.pdf','زهرا','صدری',23000010,'3.036','3.52'),(66,'13',NULL,'<p align=\"center\" dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tباسمه تعالی</p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\t<strong>سرکار خانم دکتر مداحی</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\t<strong>مدیر محترم مرکز پایش و ارزیابی عملکرد</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tبا سلام &nbsp;و احترام</p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tنظر به اعلام نتایج ارزیابی عملکرد کارکنان در سال 1395، در خصوص موارد مطرح شده در ارزیابی اینجانب، نکات ذیل ارائه می&shy;گردد:</p>\r\n<p dir=\"RTL\">\r\n\tدر خصوص بند 13 انتقاد پذیری(ظرفیت پذیرش انتقادات و کوشش در اصلاح رفتارهای ناپسند بدون نشان دادن عکس العمل منفی) ضمن جلب توجه سرکارعالی به نکات مطرح شده در درخواست تجدید نظر بند 3 و 11 و پیوست نمودن نظر همکارانم در این خصوص، از شما درخواست دارم نسبت به استعلام از سرکار خانم دکتر خادمی در خصوص ذکر موارد عدم انتقادپذیری اینجانب دستور لازم را مبذول فرمایید.</p>\r\n',0,'2017-05-22 03:51:09','1495452069._hosnekholgh.pdf','زهرا','صدری',23000010,'2.484','2.88'),(67,'14',NULL,'<p>\r\n\t<br type=\"_moz\" />\r\n\tبا توجه به وقت کمی که در زمان ارزیابی داشتیم تعدادی از کاربرگ های تکمیل شده برای کار گروهی و تعدادی از مستندات گزارش دهی ارسال نگردید.</p>\r\n',0,'2017-05-22 04:12:43','1495453364._kar timi.pdf','ملیحه','قانع عبادی',31010008,'6.38','8.52'),(68,'14',NULL,'<p align=\"center\" dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tباسمه تعالی</p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\t<strong>سرکار خانم دکتر مداحی</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\t<strong>مدیر محترم مرکز پایش و ارزیابی عملکرد</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tبا سلام &nbsp;و احترام</p>\r\n<p dir=\"RTL\" style=\"margin-right: 13.05pt;\">\r\n\tنظر به اعلام نتایج ارزیابی عملکرد کارکنان در سال 1395، در خصوص موارد مطرح شده در ارزیابی اینجانب، نکات ذیل ارائه می&shy;گردد:</p>\r\n<p dir=\"RTL\">\r\n\tدر خصوص بند 14 کارگروهی (حضور فعال در گروه های کاری و ایجاد هم افزایی در واحد مربوطه به بخشی از کارهای گروهی که در آن مشارکت داشته&shy;ام اشاره می&shy;نمایم:</p>\r\n<ul>\r\n\t<li dir=\"RTL\">\r\n\t\tسرپرست اردوی مشهد مقدس پاییز 1395 معاونت فرهنگی و اجتماعی</li>\r\n\t<li dir=\"RTL\">\r\n\t\tدستیار سرپرست اردوی مشهد مقدس بهمن 1395 معاونت فرهنگی و اجتماعی</li>\r\n\t<li dir=\"RTL\">\r\n\t\tدستیار سرپرست اردوی مشهد مقدس اسفند 1395 معاونت فرهنگی و اجتماعی</li>\r\n\t<li dir=\"RTL\">\r\n\t\tهمکاری در برپایی جشنواره لباس مشاغل بانوان دی ماه 1395</li>\r\n\t<li dir=\"RTL\">\r\n\t\tهمکاری با ستاد اجرایی جشنواره بانوی کرامت</li>\r\n\t<li dir=\"RTL\">\r\n\t\tهمکاری با کمیته عفاف و حجاب دانشگاه</li>\r\n\t<li dir=\"RTL\">\r\n\t\tهمکاری با گروه معارف دانشگاه در برپایی امتحانات این گروه در ترم مهر 1395</li>\r\n\t<li dir=\"RTL\">\r\n\t\tهمکاری در جشنواره میل و قلاب</li>\r\n\t<li dir=\"RTL\">\r\n\t\tهمکاری در مراسم استقبال از دانشجویان جدیدالورود</li>\r\n\t<li dir=\"RTL\">\r\n\t\tهمکاری در برپایی جشن دانشجویان جدیدالورود</li>\r\n</ul>\r\n<p dir=\"RTL\" style=\"margin-right: 31.05pt;\">\r\n\tدر این خصوص جهت جلوگیری از اطاله کلام، توجه سرکارعالی را به موارد مطرح شده در درخواست تجدید نظر بند 21 جلب می&shy;نمایم.</p>\r\n<p dir=\"RTL\" style=\"margin-right: 31.05pt;\">\r\n\tکاربرگهای کارگروهی یکی از &nbsp;اردوهای مشهد، جشن و مراسم استقبال از دانشجویان ورودی قبلا ارسال گردیده، لذا به پیوست حکم ماموریت اردوی مشهد، نامه تقدیر همکاری در برگزاری امتحانات عمومی و تااییدیه همکاران حضور سرکارعالی ایفاد می&shy;گردد.</p>\r\n',0,'2017-05-22 04:15:23','1495453523._mosharekat.rar','زهرا','صدری',23000010,'7.27','8.52'),(69,'22',NULL,'<p>\r\n\tبه دلیل نامناسب بودن زمان ارزشیابی و حجم کار در آموزش امکان بارگذاری برخی مستندات میسر نشد.</p>\r\n',0,'2017-05-22 04:21:03','1495453863._gozaresh95.rar','ملیحه','قانع عبادی',31010008,'4.53','6.4'),(70,'15',NULL,'<p align=\"center\" dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\tباسمه تعالی</p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\t<strong>سرکار خانم دکتر مداحی</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\t<strong>مدیر محترم مرکز پایش و ارزیابی عملکرد</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\tبا سلام &nbsp;و احترام</p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\tنظر به اعلام نتایج ارزیابی عملکرد کارکنان در سال 1395، در خصوص موارد مطرح شده در ارزیابی اینجانب، نکات ذیل ارائه می&shy;گردد:</p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\tدر مورد بند 15 دوره های آموزشی، لیست دوره های آموزشی که بنده در سال 1395 شرکت نمودم شامل:</p>\r\n<p dir=\"RTL\" style=\"margin-right: 32.4pt;\">\r\n\t&nbsp;</p>\r\n<ol>\r\n\t<li dir=\"RTL\">\r\n\t\tشرکت در کارگاه آموزش شغلی &quot; آشنایی با دستورالعمل ارزیابی اعضای غیر هیأت علمی&quot; 1395</li>\r\n\t<li dir=\"RTL\">\r\n\t\tشرکت در دوره آموزشی &quot;کارشناس اتوماسیون اداری&quot; 1395</li>\r\n\t<li dir=\"RTL\">\r\n\t\tشرکت در کارگاه آموزشی &quot;بیماری&shy;های شایع زنان&quot; 27/7/1395</li>\r\n\t<li dir=\"RTL\">\r\n\t\tشرکت در کارگاه &quot;کار گروهی&quot; معاونت فرهنگی و اجتماعی 28/10/1395</li>\r\n\t<li dir=\"RTL\">\r\n\t\tشرکت در جلسه اول گزارش نویسی اداری 3/1395</li>\r\n\t<li dir=\"RTL\">\r\n\t\tشرکت در جلسه اول کارگاه خلاقیت 8/1395</li>\r\n</ol>\r\n<p dir=\"RTL\" style=\"margin-right: 32.4pt;\">\r\n\tکه مستندات مورد 2 و 3 به پیوست ارائه می&shy;گردد. در خصوص این بند شایان ذکر است علی رغم تمایل بسیار زیادی که به شرکت در این کارگاه&shy;ها دارم، به دلیل چند مسئولیتی بودن و مشغله فراوان شغلی، امکان حضورم در بسیاری از دوره&shy;های آموزشی که توسط دفتر طرح و برنامه و بسیج کارکنان ترتیب می&shy;دهد وجود ندارد. مثلا در مورد کارگاه خلاقیت و کارگروهی تنها در یکی از جلسات شرکت کردم و جلسه دوم مقارن با اردوی مشهد شد و امکان حضورم در آن کلاس فراهم نشد . به همین دلیل در فرم خود ارزیابی به جای این بند بند 26 را با عنوان چند مسئولیتی به فرم اضافه نمودم.</p>\r\n',0,'2017-05-22 04:28:10','1495454290._dorehayeamozeshi.rar','زهرا','صدری',23000010,'3.036','5'),(71,'7',NULL,'<p align=\"center\" dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\tباسمه تعالی</p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\t<strong>سرکار خانم دکتر مداحی</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\t<strong>مدیر محترم مرکز پایش و ارزیابی عملکرد</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\tبا سلام &nbsp;و احترام</p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\tنظر به اعلام نتایج ارزیابی عملکرد کارکنان در سال 1395، در خصوص موارد مطرح شده در ارزیابی اینجانب، نکات ذیل ارائه می&shy;گردد: بند 7 تعالی سازمانی( تلاش در راستای بهبود عملکرد و تحقق اهداف واحد و دانشگاه) با توجه به نظر خانم دکتر خادمی در بند9 که امتیاز کاملی در بحث رفتار فردی و داوطلبانه منجر به ارتقای اثر بخشی واحد خارج از شرح وظایف سازمانی و یا خارج از ساعت اداری در نظر گرفته اند، این سوال مطرح می شود که فردی که خارج از وظایف سازمانی و بیشتر از مسیولیت برای ارتقای سازمان تلاش میکند چگونه است که در بند 7 امتیاز کامل را کسب نکرده است. به نظر می رسد فردی که امتیاز کامل بند 7 را کسب کند الزاما نمی تواند امتیاز کامل بند 9 را کسب کند اما فردی که در بند 9 نمره کامل را می گیرد حتما در بند 7 نیز کاملا وظایفش را انجام داده است. لذا با توجه به این تناقض و اینکه به علت محدودیت های موجود تنها برخی از فعالیتهای خود را به پیوست ارائه نموده ام، مستدعی است در این مورد تجدید نظر نمایید.</p>\r\n',0,'2017-05-22 04:39:31','1495454971._taali.rar','زهرا','صدری',23000010,'1.38','1.6'),(72,'17',NULL,'<p align=\"center\" dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\tباسمه تعالی</p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\t<strong>سرکار خانم دکتر مداحی</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\t<strong>مدیر محترم مرکز پایش و ارزیابی عملکرد</strong></p>\r\n<ul>\r\n\t<li dir=\"RTL\">\r\n\t\tبا سلام &nbsp;و احترام</li>\r\n\t<li dir=\"RTL\">\r\n\t\tنظر به اعلام نتایج ارزیابی عملکرد کارکنان در سال 1395، در خصوص موارد مطرح شده در ارزیابی اینجانب، نکات ذیل ارائه می&shy;گردد:</li>\r\n\t<li dir=\"RTL\">\r\n\t\tدر مورد بند17 آموزش به دیگران ( توانایی انتقال معلومات و مهارتهای شغلی به همکاران)، موارد تحویل مسئولیت و انتقال معلومات شغلی به همکاران شامل موارد ذیل می باشد، که نامه شماره 2234/6/95د تاریخ 19/3/1395 با امضای خود خانم دکتر خادمی تأییدیه همین موارد است.</li>\r\n\t<li dir=\"RTL\">\r\n\t\tتحویل مسئولیت کارشناس بند فرهنگی ارتقا اساتید به سرکار خانم زهره جمالی 1391</li>\r\n\t<li dir=\"RTL\">\r\n\t\tتحویل مسئولیت کارشناس تشکل&shy;های سیاسی به سرکار خانم طاهره هوشنگی 1391</li>\r\n\t<li dir=\"RTL\">\r\n\t\tتحویل مسئولیت رابط فرهنگی خوابگاه به سرکار خانم فاطمه فرخاری 1394</li>\r\n\t<li dir=\"RTL\">\r\n\t\tدرستاست که موارد انتقال تجربیات ذکر شده مربوط به سالهای قبل از 1395ز می&shy;باشد، اما چطور ممکن است فردی تا سال 1395 توانایی انتقال تجربیات شغلی به نجو احسن را دارا باشد و در سال 95 این توانایی را از دست بدهد. به علاوه در خصوص نیروهای جدید که به نیروهای معاونت فرهنگی و اجتماعی اضافه شدند، نیز تمام تلاش خود را جهت انتقال تجربیات شغلی و آموزش نحوه نامه نگاری اداری و استفاده از اتوماسین اداری به کار گرفتم. کارتابل اتوماسین اداری بنده شاهدی بر این مدعاست چرا که در مدت زمانی که نامبردگان به اتوماسین اداری دسترسی نداشتند اکثر نامه های خانم&shy;ها عطیه کاظم فرحزادی و فاطمه فرخاری از طریق اتوماسیون بنده ارسال شده است.</li>\r\n</ul>\r\n',0,'2017-05-22 05:14:10','1495457050._amozesh bedigaran.rar','زهرا','صدری',23000010,'2.484','2.88'),(73,'20',NULL,'<p align=\"center\" dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\tباسمه تعالی</p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\t<strong>سرکار خانم دکتر مداحی</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\t<strong>مدیر محترم مرکز پایش و ارزیابی عملکرد</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 54pt;\">\r\n\tبا سلام &nbsp;و احترام</p>\r\n<p dir=\"RTL\" style=\"margin-right: 54pt;\">\r\n\tنظر به اعلام نتایج ارزیابی عملکرد کارکنان در سال 1395، در خصوص موارد مطرح شده در ارزیابی اینجانب، نکات ذیل ارائه می&shy;گردد:</p>\r\n<p dir=\"RTL\" style=\"margin-right: 54pt;\">\r\n\tدر خصوص بند 20 خلاقیت و نوآوری (ارائه پیشنهادات کارشناسی و بهبود فرآیند انجام کار در حیطه وظایف شغلی سه مورد قبلا از طریق فرم خودارزیابی همراه مستندات ارسال گردیده، که شامل موارد ذیل می&shy;باشد:</p>\r\n<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" dir=\"rtl\" style=\"width: 614px;\" width=\"614\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td style=\"width: 321px; height: 41px;\">\r\n\t\t\t\t<p align=\"right\" dir=\"LTR\">\r\n\t\t\t\t\t<span dir=\"RTL\">پیشنهاد شاخص&shy;های تعیین رابط فرهنگی دانشکده&shy;ها</span></p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style=\"width: 321px; height: 45px;\">\r\n\t\t\t\t<p align=\"right\" dir=\"LTR\">\r\n\t\t\t\t\t<span dir=\"RTL\">ارائه طرح&shy;های خلاق در خصوص برنامه&shy;های فرهنگی خوابگاه به وزارت علوم</span></p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td style=\"width: 321px; height: 40px;\">\r\n\t\t\t\t<p align=\"right\" dir=\"LTR\">\r\n\t\t\t\t\t<span dir=\"RTL\">ارائه پیشنهادات جهت تنظیم سند شورای راهبردی معاونت فرهنگی</span></p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n<div style=\"clear: both;\">\r\n\t&nbsp;</div>\r\n<p dir=\"RTL\">\r\n\t&nbsp;شایان ذکراست پیشنهاد در خصوص بهبود فرآیند مالی معاونت فرهنگی و اجتماعی و همچنین راهکارهای کاهش تنش بین همکاران از موارد دیگری بود که در جلسات داخلی معاونت فرهنگی به طور شفاهی توسط اینجانب مطرح شد گر چه هیچ یک از این پیشنهادات اجرا نشد.</p>\r\n',0,'2017-05-22 05:30:13','1495458013._khalaghiat.rar','زهرا','صدری',23000010,'4.564','7.24'),(74,'8',NULL,'<p align=\"center\" dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\tباسمه تعالی</p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\t<strong>سرکار خانم دکتر مداحی</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 14.4pt;\">\r\n\t<strong>مدیر محترم مرکز پایش و ارزیابی عملکرد</strong></p>\r\n<p dir=\"RTL\" style=\"margin-right: 54pt;\">\r\n\tبا سلام &nbsp;و احترام</p>\r\n<p dir=\"RTL\" style=\"margin-right: 54pt;\">\r\n\tنظر به اعلام نتایج ارزیابی عملکرد کارکنان در سال 1395، در خصوص موارد مطرح شده در ارزیابی اینجانب، نکات ذیل ارائه می&shy;گردد:</p>\r\n<p dir=\"RTL\" style=\"margin-right: 54pt;\">\r\n\tدر خصوص بند 8 مشارکت در تنظیم سند راهبردی معاونت فرهنگی از طریق لرائه نظرات و پیشنهادات، مشارکت در تعیین شاخص های رابط فرهنگی دانشکده&shy;ها، مشارکت در تنظیم شیوه نامه اجرایی اردوهای دانشجویی از جمله فعالیتهای اینجانب در تنظیم خط مشی داخلی و شیوه نامه های مورد نیاز معاونت بود. که مستندات بخش خلاقیت در این مورد دوباره پیوست می گردد.</p>\r\n',0,'2017-05-22 05:56:49','1495459609._khalaghiat.rar','زهرا ','صدری',23000010,'3.036','3.52'),(75,'4',NULL,'<p>\r\n\t<br type=\"_moz\" />\r\n\tخانم دکتر خادمی باید مدارکی دال بر عدم وجود این شاخص در بنده را ارائه دهند. بنده با تلاش هایبسیارو ناشی از وجدان کار تمامی مکاتبات با شرداری در زمینه صرفه جویی و کاهش هزینه های معاونت را انجام داده و به سرانجام رسانیده و حتی روز پنج شنبه بدون خواست و اطلاع مافوق به اداره اماکن( نیروی انتظامی ) رفته و هزینه واریز وجه 6 میلیون تومانی را به 2 میلیون تومان تقلیل داده ( برای برگزاری جشن دانش آموختگی در برج میلاد)&nbsp;در پی تلاشهای بسیار بنده تخفیف 20 درصدی از برج میلاد گرفتم&nbsp;و همچنین چندین ماه&nbsp; در رفت و آمد با شهرداری جهت دریافت هزینه رنگ آمیزی معاونت از سوی شهردای بوده که موفق هم گردیدم</p>\r\n',0,'2017-05-23 07:06:01','1495506961._New folder.rar','فرانک','نیسی',23000009,'3.12','3.84'),(76,'20',NULL,'<p>\r\n\tبا توجه به این که&nbsp; در شاخص&nbsp;&nbsp;&nbsp;14 بنده به عنوان کارشناس مسئول هدایت وکنترل افرا