ی باشد.</p>\r\n<p style=\"text-align: left;\">\r\n\tبا سپاس مژگان آذرخش</p>\r\n',0,'2017-05-23 05:41:12','1495545072._seven.zip','مژگان','آذرخش',24200006,'4.2','6.4'),(170,'20',NULL,'<p>\r\n\tیا احترام</p>\r\n<p>\r\n\tبه پیوست ارسال شده است.</p>\r\n',0,'2017-05-23 05:45:05','1495545305._khalaghat.docx','سمیرا سادات','رسولی',24200009,'4.75','7.24'),(171,'10',NULL,'<p>\r\n\tبه پیوست است</p>\r\n',0,'2017-05-23 05:48:11','1495545491._vazaef shoghli.docx','زهرا','رازفر',24200008,'2.784','3.648'),(172,'22',NULL,'<p>\r\n\tیا احترام</p>\r\n<p>\r\n\tبه پیوست ارسال شده است.</p>\r\n',0,'2017-05-23 05:50:25','24200009.22.docx','سمیرا سادات','رسولی',24200009,'4.3','6.4'),(173,'14',NULL,'<p>\r\n\tبه دلیل آنکه ماهیت کار اینجانب گروهی می باشد. اسناد و مدارک کار گروهی ارسال گردید</p>\r\n',0,'2017-05-23 05:51:27','1495545687._mehrabi.karegoroohi.rar','رقیه','محرابی',24000003,'\t5.726','8.52'),(174,'2',NULL,'<p>\r\n\tاینجانب طبق ساعات کارت زنی در 5 ماه آخر سال 1395 به مدت 63 ساعت اضافه کار داشته ام.</p>\r\n',0,'2017-05-23 05:51:46','40000004.2.docx','هانیه ','فتاح زاده میاندواب',40000004,'5.652','6.84'),(175,'16',NULL,'<p>\r\n\tبه پیوست است</p>\r\n',0,'2017-05-23 05:54:45','1495545885._afzayesh danesh.docx','زهرا','رازفر',24200008,'2076','3.2'),(176,'20',NULL,'<p>\r\n\tبه پیوست است</p>\r\n',0,'2017-05-23 05:59:11','1495546151._pishnahad.docx','زهرا','رازفر',24200008,'6.124','6.878'),(177,'24',NULL,'<p>\r\n\tبا احترام</p>\r\n<p>\r\n\tبه پیوست ارسال شده است.</p>\r\n',0,'2017-05-23 06:00:51','1495546251._narm afzar.docx','سمیرا سادات','رسولی',24200009,'2.86','3.52'),(178,'22',NULL,'<p>\r\n\tبه پیوست است</p>\r\n',0,'2017-05-23 06:04:31','1495546471._gozareshat.docx','زهرا','رازفر',24200008,'4.28','5.76'),(179,'25',NULL,'<p>\r\n\tبا احترام</p>\r\n<p>\r\n\tبه پیوست ارسال شده است.</p>\r\n',0,'2017-05-23 06:05:36','1495546536._samaneh.docx','سمیرا سادات','رسولی',24200009,'2.56','3.2'),(180,'3',NULL,'<p>\r\n\tاینجانب همواره با مدیر، اعضای اساتید، همکاران، دانشجویان و کلیه ارباب رجوع نهایت ادب را رعایت نموده و سعی در حسن خلق و گشاده رویی دارم. در نظر سنجی که از تعدادی از مراجعین صورت گرفته است گویای این مطلب می باشد. البته قابل ذکر است به علت ذیق وقت و همزانی با فرجه امتحانات دانشجویان، نظرسنجی دانشجویی کم میباشد. که ان شاءالله تکمیل خواهد شد.</p>\r\n',0,'2017-05-23 06:07:24','40000004.3.docx','هانیه ','فتاح زاده میاندواب',40000004,'2.784','3.84'),(181,'24',NULL,'<p>\r\n\tبه پیوست است</p>\r\n',0,'2017-05-23 06:08:54','1495546734._narm afzar.docx','زهرا','رازفر',24200008,'2.332','3.168'),(182,'25',NULL,'<p>\r\n\tبه پیوست است</p>\r\n',0,'2017-05-23 06:13:30','1495547010._fava.docx','زهرا','رازفر',24200008,'2.12','2.72'),(183,'4',NULL,'<p>\r\n\tهمیشه سعی در انجام شرح وظایف خود&nbsp;داشته و به دلیل وجدان کاری&nbsp;&nbsp;نیازی به کنترل مدیر یا شخص دیگری ندارم</p>\r\n<p>\r\n\tاز نمره پایین این قسمت متعجبم چرا که سرکار خانم دکتر صف آرا به مدیر محترم امور اداری&nbsp;اعلام کرده بودند&nbsp;که از کار و حسن خلق اینجانب رضایت دارند. و حتی در حضور اینجانب به اعضای هیات علمی پژوهشکده زنان اعلام نموده اند که خانم فتاح زاده دست راست من می باشد.</p>\r\n<p>\r\n\tبازهم مراجعه شود به نظرسنجی مراجعین از اینجانب</p>\r\n',0,'2017-05-23 06:15:24','40000004.4.docx','هانیه ','فتاح زاده میاندواب',40000004,'2.256','3.84'),(184,'6',NULL,'<p>\r\n\tبا وجود حجم بالای کار سعی در انجام وظایف به نحو احسن را دارم. که در این موارد تعدادی از&nbsp;افرادی که با اینجانب همکاری داشته اند نظر مثبت&nbsp;داده اند.</p>\r\n<p>\r\n\t&nbsp;</p>\r\n<p>\r\n\t&nbsp;</p>\r\n',0,'2017-05-23 06:20:47','40000004.6.docx','هانیه ','فتاح زاده میاندواب',40000004,'2.256','3.84'),(185,'7',NULL,'<p>\r\n\tاززمانی که در کتابخانه پژوهشکده زنان مشغول به کار شدم، برای بهبود عملکرد پژوهشکده تلاش کرده ام. خیلی از مواقع فقط و فقط به نظور پیشرفت سازمان،&nbsp;بدون داشتن حکم یا نامه کتبی از طرف مدیر، انجام وظایف نمودم.&nbsp;</p>\r\n',0,'2017-05-23 06:32:09','40000004.7.docx','هانیه ','فتاح زاده',40000004,'1.16','1.6'),(186,'9',NULL,'<p style=\"text-align: justify;\">\r\n\t- درصورت حجم بالای کار و احساس ضرورت برای انجام کار بدون درخواست مدیر بخش ساعات اضافه را در دانشگاه خدمت کرده ام. در 5 ماه آخر سال 95 به مدت&nbsp;63 ساعت اضافه کر داشته ام.</p>\r\n<p style=\"text-align: justify;\">\r\n\t- در رایزنی که در اسفند ماه، برای کنگر بین المللی نقش زن انجام دادم به خدمت سرکار خانم دکتر قهرمانی قاجار رسیده و از ایشان قول کمک دو میلیون تومان حمایت مالی برای کنگره مذکور را اخذ کردم. با اطلاع این مطلب به سرکار خانم دکتر صف ارا ایشان ابراز خوشنودی نمودند.</p>\r\n<p>\r\n\t&nbsp;</p>\r\n',0,'2017-05-23 06:50:37','40000004.9.docx','هانیه ','فتاح زاده میاندواب',40000004,'2.76','3.2'),(187,'10',NULL,'<p>\r\n\t<br type=\"_moz\" />\r\n\tبه علت علاقه به کار در کتابخانه تصمیم به ادامه تحصیل در رشته علم اطلاعات و دانش شناسی نمودم. همچنین در کارگاه های آموزشی از جمله &quot;آشنایی با&nbsp;سازمان ملل و اسناد و و مدارک آن با تاکید بر موضوعات مربوط به زنان&quot; برای افزایش اطلاعات و آگاهی خود شرکت نمودم.</p>\r\n',0,'2017-05-23 06:59:18','1495549758._IMG_0001_NEW.pdf','هانیه','فتاح زاده میاندواب',40000004,'2.784','3.84'),(188,'11',NULL,'<p>\r\n\tاینجانب همیشه سعی نموده ام حسن خلق و ادب را در معاشرت با همه مراجعین رعایت نمایم.</p>\r\n<p>\r\n\tکه ادعای خود مراجعین وهمکاران این نکته را اثبات می کند.</p>\r\n',0,'2017-05-23 07:04:37','1495550077._form.docx','هانیه ','فتاح زاده میاندواب',40000004,'2.552','3.52'),(189,'13',NULL,'<p>\r\n\tهمیشه از انتقاد سازنده استقبال نموده و سعی در اصلاح داشتم.</p>\r\n',0,'2017-05-23 07:07:30','1495550250._form.docx','هانیه ','فتاح زاده میاندواب',40000004,'1.692','2.88'),(190,'14',NULL,'<p>\r\n\tاز نظر خود و افرادی که با اینجانب کارگروهی انجام داده اند، موفق بوده و معمولا تکمیل مطالب جمع آوری شده توسط همکاران و خود، به عهده اینجانب بوده است.</p>\r\n<p>\r\n\tمثل جمع آوری گزارش عمکرد پژوهشکده زنان</p>\r\n<p>\r\n\tتهی پاورپوینت از عملکردپژوهشکده</p>\r\n<p>\r\n\tهمکاری در همایشها</p>\r\n',0,'2017-05-23 07:12:25','1495550545._hhh.ppt','هانیه ','فتاح زاده میاندواب',40000004,'6.732','8.52'),(191,'15',NULL,'<p>\r\n\t1- تلاش در ادامه تحصیل در رشته مرتبط با محل خدمت</p>\r\n<p>\r\n\t2 شرکت در کارگاه آموزشی مرتبط</p>\r\n',0,'2017-05-23 07:14:32','1495550672._IMG_0001_NEW.pdf','هانیه','فتاح زاده',40000004,'5.546','6.52'),(192,'17',NULL,'<p>\r\n\t<br type=\"_moz\" />\r\n\tفرم نظرسنجی</p>\r\n',0,'2017-05-23 07:20:29','1495551029._sha17.docx','هانیه ','فتاح زاده',40000004,'2.088','2.88'),(193,'19',NULL,'<p>\r\n\tبه فرم نظرسنجی مراجعه شود</p>\r\n',0,'2017-05-23 07:23:46','1495551226._form.docx','هانیه ','فتاح زاده',40000004,'2.552','3.52'),(194,'20',NULL,'<p>\r\n\tاز نظر سرکار خانم دکتر شجاع نوری مدیر سابق و سرکار خانم دکتر صف آرا، مدیر فعلی پژوهشکده، اینجانب معمولا دارای ایده و نظر نو بوده ام. و معمولا خلاقیت در کار داشتم. به همین دلیل هر دو بزرگوار&nbsp;مسئولیت روابط عمومی پژوهشکده&nbsp;را به اینجانب سپرده اند.</p>\r\n<p>\r\n\tنظر سنجی همکاران نیز این مطلب را&nbsp;به اثبات می رساند.&nbsp;</p>\r\n',0,'2017-05-23 07:27:16','1495551436._form.docx','هانیه ','فتاح زاده',40000004,'6.022','7.24'),(195,'23',NULL,'<p>\r\n\tسرکار خانم دکتر صف آرا اد تحلل عملکرد اینجانب اعلام نمودند اینجنب توانایی نسبتا خوبی در آیین نگارش دارا هستم.</p>\r\n',0,'2017-05-23 07:33:29','1495551809._sha23.docx','هانیه','فتاح زاده',40000004,'2.07','2.4'),(196,'21',NULL,'<p>\r\n\tموارد پیشنهادی با مدیریت و ریاست دانشگاه و معاون اموزشی پس از بررسی موضوعات دانشجویان غیر ایرانی.&nbsp;</p>\r\n<p>\r\n\tپیشنهادات در هیات امنا سال 1396</p>\r\n<p>\r\n\tتصویب تغییر شهریه دانشجویان غیر ایرانی به پیشنهاد اینجانب در سال 1395</p>\r\n',0,'2017-05-23 07:39:33','1495552173._meeting.docx','ناهید ','پازن',13000001,'6.33','7.24'),(197,'23',NULL,'<p>\r\n\tهمانطور که سرکار خانم دکتر صف آرا هم در تحلیل عملکرد اشاره نمودند اینجانب توانایی نسبتا خوب در آیین نگارش نامه دارم.</p>\r\n',0,'2017-05-23 07:39:51','1495552191._sha24.pdf','هانیه ','فتاح زاده',40000004,'2.07','2.4'),(198,'24',NULL,'<p>\r\n\t<span style=\"font-size: 16px;\">اینجانب مسلط به نرم افزارهای موجود در کتابخانه می باشم. </span></p>\r\n<p>\r\n\t<span style=\"font-size: 16px;\">همچنین سعی در آموزش این نرم افزارها به مراجعین را دارم. </span></p>\r\n<p>\r\n\t<span style=\"font-size: 16px;\">هر سال در هفته پژوهش برای دانشجویان و مراجعین کارگاه آموزشی برگزار می نمایم.</span></p>\r\n',0,'2017-05-23 07:43:06','1495552386._sha24.pdf','هانیه ','فتاح زاده',40000004,'3.036','3.52'),(199,'22',NULL,'<p>\r\n\tکلیه شیوه نامه ها ودستورالعمل های اجرایی دانشجویان بورسیه وغیربورسیه غیر ایرانی و شیوه نامه پذیرش فرصت مطالعاتی که برروی سایت این مدیریت قرار دارد توسط اینچانب تهیه گردیده است.</p>\r\n',0,'2017-05-23 07:46:08','1495552568._scholaqrship.docx','ناهید ','پازن',13000001,'3.7','6.4'),(200,'1',NULL,'<p>\r\n\tدر خصوص تحلیل عملکرد چون گزینه ای برای ارائه مستندات وجود نداشت مجبور شدم در این قسمت قرار دهم.</p>\r\n',0,'2017-05-23 07:47:16','40000004.1.docx','هانیه ','فتاح زاده',40000004,'1','1'),(201,'14',NULL,'<p>\r\n\tاینجانب در طی 25 سال سابقه کاری تقدیر نامه های زیادی از رییسان مختلف دانشگاه برای برگزاری 10 سمینار ملی، برگزاری 15 دوره هفته پژوهش، 2 برنامه تبیین قیام امام حسین با شرکت 700 دانشجوی خارجی از جمله دانشجوهای خارجی تهران، 2 برنامه افطاری برای دانشجویان غیر ایرانی &nbsp;با حضور 700 دانشجوی غیر ایرانی و روز بین المللی با حضور 400 دانشجوی غیر ایرانی دریافت نموده ام. در تمامی این برنامه ها و دیگر برنامه های مشابه دبیر اجرایی برنامه بوده ام. برای نمونه یک نمونه از تقدیرنامه های دریافتی را پیوست می نمایم.&nbsp;</p>\r\n',0,'2017-05-23 07:56:47','1495553207._Kar groohi.karbarg.docx','ناهید ','پازن',13000001,'7.626','8.52'),(202,'20',NULL,'<p>\r\n\tپیشنهاد تهیه شیوه نامه پذیرش فرصت مطالعاتی در دانشگاه الزا که در نهایت منجر به تهیه این شیوه نامه وتصویب آن شد.</p>\r\n<p>\r\n\tموارد مطرح شده و پیشنهادی در جلسه مدیریت با ریاست و معاون آموزشی که در روز 30/2/1396 ساعت 13:30 برگزار گردید.</p>\r\n<p>\r\n\tجدول پیشنهادی تغییر شهریه که در سال 1395 به تصوییب هیات امنا رسید. &nbsp;</p>\r\n<p>\r\n\tو موارد دیگر که به دلیل ضعف سامانه که پیوست کردن مستندات مقدور نمی باشد.</p>\r\n',0,'2017-05-23 08:06:07','1495553767._sabbatical.docx','ناهید ','پازن',13000001,'6.33','7.24'),(203,'9',NULL,'<p>\r\n\tنمایش صفحه تردد اینجانب تنها در اردیبهشت ماه که از کم کارترین ماه های سال برای اینجانب می باشد راپیوست می نمایم و توجه شما را به حضور در روز پنجشنبه، روز تعطیل و ساعات 21 و 20 شب در صورت لزوم، و حضور در مرداد ماه که ماه تعطیلی دانشگاه است جلب می نمایم.</p>\r\n<p>\r\n\t&nbsp;</p>\r\n',0,'2017-05-23 08:15:58','1495554358._taradod 1.jpg','ناهید ','پازن',13000001,'2.76','3.2'),(204,'19',NULL,'<p>\r\n\tتمام مدارک پیوست شده در موارد بالا حاکی از این قضیه است که اینجانب به وظایف شغلی و ایین نامه ها و شرح وظایف این دفتر می باشد و قابل ذکر است تمامی امور جاری این دفتر را از صفر راه اندازی کرده و شیوه های اجرایی آن را نیز طراحی نموده ام و کلیه مدیران و کارمندان وارد شده به این حوزه را از ابتدا اینجانب آموزش داده ام چون تنها کارمند این حوزه در طی سال های طلانی &nbsp;بوده ام (بدون حضور مدیر) و عامل تاثیرگذر &nbsp;توسعه وپیشرفت این حوزه بوده ام. و قابل ذکر است یا توجه به ایده های نو و پیشنهاد کارهای جدید برای اینجانب تعجب اور است که مدیر فعلی این حوزه عدم ارائه ایده های نو و مسئولیت پذیری را جزء نقطه ضعف های اینجانب ذکر نموده اند. ساعات کاری، ایین نامه های مصوب ین حوزه و کلیه کارهای جدید این حوزه دلیلی بر این مدعا هستند. (تهیه نامه های انگلیسی برای اساتید و دانشجویان و سایر کارهای مربوط به تایید مدارک دانشجویان برای ادامه تحصیال در خارج از ایران نه جزء سرفصل تعریفی وزه بوده و نه از طرف مقامات مافوق به این حوزه واگذار گردیده است ولی اینجانب با انجام این امور اقدام به حل مشکلات بندگان خدا نموده ام که یک نمونه ارسال می گردد.) و نسبت به کسر امتیاز به صورت ریز از تمامی موارد شاخص ها از طرف مدیر اعتراض داشته ولی بیش از این صلاح نمی بینم در تمامی موارد وقت شما را بگیرم.</p>\r\n<p>\r\n\t&nbsp;</p>\r\n',0,'2017-05-23 08:35:48','1495555548._to whom. student.pdf','ناهید ','پازن',13000001,'3.036','3.52'),(205,'15',NULL,'<p>\r\n\tبا توجه به این که بنده دردو دوره تخصصی (64 ساعت آموزشی) شرکت کردهام که اطلاات آن در برگزاری کیفیت سمینارهایی که برگزار می کنم بسیار مفید بودهخواهشمند است در صورت امکان تجدید نظر فرمایید.</p>\r\n',0,'2017-05-24 03:31:41','24200001.15.jpg','نسرین','رمضانی',24200001,'4.53','6.52'),(206,'20',NULL,'<p>\r\n\t&nbsp;بنده در بخش دوره های آموزشی و کارکنان چند پیشنهاد دادم که عملیاتی هم نمودم من جمله مشاوره و ترکیب بدن کارکنان، تغذیه تیم های ورزشی و هم چنین سمینارهای علم تمرین که بسیار در بهبود کیفیت آموزش دانشجویان موثز بود. خواهشمندم که تجدید نظر فرمایید.سپاس</p>\r\n',0,'2017-05-24 03:50:11','24200001.20.docx','نسرین ','رمضانی',24200001,'5.49','7.24'),(207,'18',NULL,'<p>\r\n\tبا توجه به این که کلیه اخبار سایت معاونت و گزارشات ماهیانه اداره و کلیه گزارشات مربوط به کارکنان و همینطور سمینارها توسط بنده ارائه می شود خواهشمندم تجدید نظر فرمایید.</p>\r\n',0,'2017-05-24 03:54:02','24200001.18.docx','نسرین','رمضانی',24200001,'5.65','6.4');

