#
# Structure for table "sh_ruydad"
#

DROP TABLE IF EXISTS `sh_ruydad`;
CREATE TABLE `sh_ruydad` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `admin_id` int(11) DEFAULT NULL,
  `type` varchar(255) COLLATE utf8_persian_ci DEFAULT NULL,
  `amaliati_no` int(6) NOT NULL DEFAULT '0',
  `title` varchar(255) COLLATE utf8_persian_ci NOT NULL DEFAULT '',
  `startdate` date NOT NULL DEFAULT '2020-01-01',
  `finishdate` date NOT NULL DEFAULT '2020-01-01',
  `time` int(2) NOT NULL DEFAULT '0',
  `nationality` varchar(15) COLLATE utf8_persian_ci NOT NULL DEFAULT '',
  `member_type` varchar(255) COLLATE utf8_persian_ci DEFAULT NULL,
  `member_no` int(11) DEFAULT NULL COMMENT 'تعداد مخاطب',
  `main_executor` varchar(20) COLLATE utf8_persian_ci NOT NULL DEFAULT '' COMMENT 'دانشگاه - سازمان بیرونی',
  `sub_executor` varchar(100) COLLATE utf8_persian_ci DEFAULT NULL,
  `execute_type` varchar(15) COLLATE utf8_persian_ci NOT NULL DEFAULT '' COMMENT 'حضوری - مجازی',
  `salon` varchar(70) COLLATE utf8_persian_ci DEFAULT NULL,
  `cost` int(11) unsigned NOT NULL DEFAULT '0',
  `income` int(11) unsigned NOT NULL DEFAULT '0',
  `website_link` varchar(255) COLLATE utf8_persian_ci NOT NULL DEFAULT '',
  `hami_type` varchar(20) COLLATE utf8_persian_ci DEFAULT NULL COMMENT 'حقیقی/حقوقی',
  `hami_income` int(11) DEFAULT NULL,
  `tozihat` text COLLATE utf8_persian_ci,
  `status` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_persian_ci;

